import React, { useState } from "react" ;
import './App.css';
import NavBar from "./NavBar.js";
import AppCalendar from "./AppCalendar.js";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <div className="App">
    <NavBar></NavBar>



    <Router>
      <div>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
         <AppCalendar />
          </Route>
        </Switch>
      </div>
    </Router>



    </div>
  );
}

export default App;

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
